import pic_side from './img/508_side.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className="home_pic">
          <img src={pic_side} width={"100%"} />
        </div> 

        <h1>Hello World</h1>

      </header>
    </div>
  );
}

export default App;
